<div id="webexSiteReportIframe-{{reportPageId}}" name="webexSiteReportIframe-{{reportPageId}}" class="webex-site-report-iframe">
  <cs-page-header id="{{reportPageId}}" name="{{reportPageId}}" title-name="{{::reportPageTitle}}">
  </cs-page-header>
  <cs-page-sub-header>
    <cs-page-sub-header-left>
    <img src="/images/webex_logo_16px.png"
                   class="webexlogo"
                   id="webexLogo"
                   name="webexLogo"
                   alt="{{'webexCommon.logoAltText' | translate}}" />
      <ul class="breadcrumbs webexPage" id="webexReportIFrameBreadCrumbs" title="{{'webexCommon.breadcrumbsAltText' | translate}}">
        <li>
          <a id="webexReportIFrameCrumb2" ui-sref="{{classicLink}}"><!--reports.webex({siteUrl:siteUrl})-->
        {{('webexSiteReports.title' | translate) + ' ' + siteUrl}}
      </a>
        </li>
        <li class="current">
          {{reportPageTitle}}
        </li>
      </ul>
      <!-- <cs-breadcrumbs displayname-property="data.displayName"></cs-breadcrumbs> -->
      <!-- {{siteUrl}} DON'T display for now -->
    </cs-page-sub-header-left>
  </cs-page-sub-header>
  <div class="content-container">
    <webex-iframe-container></webex-iframe-container>
  </div>
</div>
